import React from 'react';

// Header Component
function Header() {
  return (
    <header className="bg-gray-800 text-white p-6">
      <div className="text-center">
        <h1 className="text-3xl font-bold">Morocco Tours & Transfers</h1>
        <p className="mt-2 text-lg">Explore seamless city-to-city transfers and captivating tours across Morocco with Morocco Tours & Transfers. From Casablanca to Marrakech, Rabat, Tangier, and beyond. We ensure your travels are safe, swift, and unforgettable.</p>
      </div>
    </header>
  );
}

// Main Section Component
function MainSection() {
  const destinations = [
    "CASA Settat", "Fès Meknès", "L'Oriental",
    "Marrakech Safi", "Rabat Salé Kénitra", "Tanger Chefchaouen"
  ];

  const images = [
    "/images/casa.jpg", "/images/fes.jpg", "/images/oriental.jpg",
    "/images/marrakech.jpg", "/images/rabat.jpg", "/images/tanger.jpg"
  ];

  return (
    <section className="p-6">
      <div className="text-center mb-8">
        <h2 className="text-2xl font-semibold">Top Destinations</h2>
      </div>
      <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6">
        {destinations.map((dest, idx) => (
          <div key={idx} className="bg-gray-300 p-4 text-center">
            <img src={images[idx]} alt={dest} className="w-full h-48 object-cover mb-4"/>
            <h3 className="font-semibold">{dest}</h3>
          </div>
        ))}
      </div>
    </section>
  );
}

// Contact Section Component
function Contact() {
  return (
    <section className="bg-gray-900 text-white p-6">
      <div className="text-center">
        <h2 className="text-2xl font-semibold">Contact Us</h2>
        <p className="mt-4">For more information or to book a tour, get in touch with us today!</p>
        <div className="mt-4">
          <p>Address: 15 Rue Taoufik Al Hakim, Casablanca 20250, Morocco</p>
          <p>Whatsapp: +212 711 90 90 99</p>
          <p>Email: support@ma-tours.com</p>
        </div>
      </div>
    </section>
  );
}

// Footer Component
function Footer() {
  return (
    <footer className="bg-gray-900 text-white text-sm p-6">
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
        <div>
          <a href="#terms" className="hover:underline">Terms and Conditions</a>
          <br />
          <a href="#privacy" className="hover:underline">Privacy Policy</a>
        </div>
        <p>COPYRIGHT 2025 MOROCCO TOURS & TRANSFERS, ALL RIGHTS RESERVED</p>
      </div>
    </footer>
  );
}

// App Component combining all sections
function Fin() {
  return (
    <div>
      <Header />
      <MainSection />
      <Contact />
      <Footer />
    </div>
  );
}

export default Fin;
